import React from "react";
import Table from "react-bootstrap/esm/Table";

const FinalizedGradeList = (props) => {
	const studentSummaries = props.cumulativeData.map((data) => {
		const assignmentSum = data.a1 + data.a2 + data.a3;
		const quizSum = data.q1 + data.q2 + data.q3 + data.q4;
		const total =
			assignmentSum + quizSum + data.project + data.midz + data.final;
		const percentage = total + "%";

		let grade, remarks;

		if (total >= 80) {
			grade = "A";
			remarks = "Excellent";
		} else if (total >= 76) {
			grade = "A-";
			remarks = "Very Good";
		} else if (total >= 72) {
			grade = "B+";
			remarks = "Good";
		} else if (total >= 68) {
			grade = "B";
			remarks = "Better";
		} else if (total >= 64) {
			grade = "B-";
			remarks = "Best";
		} else if (total >= 60) {
			grade = "C+";
			remarks = "Not Good";
		} else if (total >= 55) {
			grade = "C";
			remarks = "Satisfactory";
		} else if (total >= 50) {
			grade = "D";
			remarks = "Not Satisfactory";
		} else {
			grade = "F";
			remarks = "Poor";
		}
		return {
			name: data.stName,
			assignmentSum,
			quizSum,
			project: data.project,
			midterm: data.midz,
			final: data.final,
			total,
			percentage,
			grade,
			remarks,
		};
	});

	return (
		<Table responsive hover bordered striped className="my-4">
			<thead>
				<tr>
					<th className="bg-dark text-white">Student Name</th>
					<th className="bg-dark text-white">Assignment Total</th>
					<th className="bg-dark text-white">Quiz Total</th>
					<th className="bg-dark text-white">Project</th>
					<th className="bg-dark text-white">Midterm</th>
					<th className="bg-dark text-white">Final</th>
					<th className="bg-dark text-white">Total</th>
					<th className="bg-dark text-white">Percentage</th>
					<th className="bg-dark text-white">Grade</th>
					<th className="bg-dark text-white">Remarks</th>
				</tr>
				<tr>
					<th></th>
					<th>15</th>
					<th>12</th>
					<th>10</th>
					<th>13</th>
					<th>50</th>
					<th>100</th>
					<th>100%</th>
					<th></th>
					<th></th>
				</tr>
			</thead>
			<tbody>
				{studentSummaries.map((data, index) => (
					<tr key={index}>
						<td>{data.name}</td>
						<td>{data.assignmentSum}</td>
						<td>{data.quizSum}</td>
						<td>{data.project}</td>
						<td>{data.midterm}</td>
						<td>{data.final}</td>
						<td>{data.total}</td>
						<td>{data.percentage}</td>
						<td>{data.grade}</td>
						<td>{data.remarks}</td>
					</tr>
				))}
			</tbody>
		</Table>
	);
};

export default FinalizedGradeList;
